  [],\n\t\"num_tags\": 0,\n\t\"name\": \"zooplankton-and-other-data-from-net-casts-in-prince-william-sound-from-the-noaa-ship-surveyor-a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Zooplankton and other data were collected
  from net casts in Prince William Sound from the SURVEYOR from 03 October 1975 to
  10 October 1975. Data were collected by the Pacific Marine Environmental Laboratory
  (PMEL) as part of the Outer Continental Shelf Environmental Assessment Program (OCSEAP).
  Data were processed by NODC to the NODC standard F124 Zooplankton Data format. Full
  format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f124.html.
  An analog file for this accession is available from NODC user services.nnThe F124
  format is used for data from sampling and analysis of marine zooplankton. Information
  on zooplankton abundance, distribution, and productivity derived from these data
  support studies of marine populations and ecosystems. Data reported may include:
  cruise information, position, date, and time of sampling; bottom depth, sampling
  depths, temperature, and salinity; gear type, volume of water filtered, total dry
  and wet weight, and other data for total haul; and data for subsamples by species.
  Data on zooplankton catch by species may include subsample size, zooplankton concentration,
  life history code, and numbers of adults, juveniles, eggs, and larvae. Estimated
  density of holoplankton and meroplankton and data on ichthyoplankton may also be
  reported. A text record is available for comments. Note: there are two options for
  reporting subsample counts of individuals at different life history stages. If life
  history codes are used, only number of adults should be reported on that record.
  Additional separate records should then be used to report number of juveniles and
  so on. Alternatively, life history codes may not be used and number of adults, juveniles,
  and so entered in the proper fields of a single record.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
